import React from "react";
import "./style.css";

function Card(props) {
  return (
      <div className={"card " } >  
          <div className="img-container">
              <img alt={props.name} src={props.image} />
          </div>
          <div className="img-content">
              <ul>
                  <li>
                      <strong>Project:</strong>{props.name}
                      <strong>Project:</strong>{props.name}
                      <strong>Project:</strong>{props.name}
                      <strong>Project:</strong>{props.name}
                  </li>

              </ul>
          </div>
      </div >
  )
}

export default Card;
